import React from "react";

import SimpleSlider from "../../Shared/PhotoSlider/SimpleSlider";
import {
  PhotoConteiner,
  SimpleSliderConteiner,
  BtnDesktop,
  VectorTop,
  MainConteiner,
} from "./style";

export default function PersonPage() {
  return (
    <MainConteiner>
      <PhotoConteiner>
        <SimpleSliderConteiner>
          <SimpleSlider />
        </SimpleSliderConteiner>
        <BtnDesktop></BtnDesktop>
        <VectorTop />
      </PhotoConteiner>
    </MainConteiner>
  );
}
